const fields = document.querySelectorAll("input, textarea, select");
const fieldData = [];

fields.forEach((field, index) => {
  const label = field.labels?.[0]?.innerText || field.getAttribute("aria-label") || "Unknown";
  const fieldId = field.id || `input_${index}`;

  field.style.border = "2px solid #4CAF50";
  field.style.backgroundColor = "#f0fff0";
  field.title = `Detected: ${label}`;

  fieldData.push({ fieldId, label });
});

chrome.runtime.sendMessage({ type: "fieldData", data: fieldData });
